import axios from "axios"
import { post, get, upload } from "src/request/api"
import { stringify } from "querystring"
const header = { 'Content-Type': 'application/x-www-form-urlencoded;charset=utf-8' }
// 在售列表
export const saleList = (data = {}) => {
 return post('/api/v1/app/sale/sale-list', data)
}
// 在售列表
export const receive = (data = {}) => {
 return post('/api/v1/app/sale/ack-sale-item-receive', stringify(data), header)
}
// 在售项未已收到款
export const notReceive = (data = {}) => {
 return post('/api/v1/app/sale/ack-sale-item-not-receive', stringify(data), header)
}

// 代售列表
export const saleBankCard = (data = {}) => {
 return post('/api/v1/app/sale/get-sale-bank-card', data)
}
// 开始代售
export const saleBankCardStart = (params: any) => {
 return post('/api/v1/app/sale/sale-bank-card/start', stringify(params), header)
}
// 停止代售
export const saleBankCardStop = (params = {}) => {
 return post('/api/v1/app/sale/sale-bank-card/idle', stringify(params), header)
}
